import Navbar from "./content/Navbar"

class Header extends Component {



    render() {

        return (<div>

            {/* navbar */}
            <div>
            <Navbar/>
            </div>

           {/* head  */}
            <div className="my-2 ">
                <div className=" bg-header jumbotron jumbotron-fluid  ">
                    <div className="container">
                        <p className="lead wheat">Hello, My Name Is</p>
                        <h1 className="display-4 wheat">Phanat Buaban.</h1>
                        <p className></p>
                    </div>
                </div>
            </div>


        </div>
        )
    }

}

export default Header;
